import React, { Component } from 'react';
import { Route } from 'react-router-dom';
import logo from './logo.svg';
import './App.css';
import config from './config';

class App extends Component {
  state = {
    genres: [],
    error: null,
  }

  setGenres = genres => {
    this.setState({
      genres,
      error: null,
    })
  }

  componentDidMount() {

    var settings = {
      "url": "https://accounts.spotify.com/api/token",
      "method": "POST",
      "timeout": 0,
      "headers": {
        "Authorization": "Basic ODI4ZDhhMGMzMDIwNGRhZDhjMWNiZDU3NmEyMTdiMDk6ZmNlOTg1MjYyYmRmNDEyMmJjZjkwMWQ5MmZhYTQzOTU=",
        "Content-Type": "application/x-www-form-urlencoded",
        "Cookie": "__Host-device_id=AQA9esAHXOkju3ilFOKDwuou0ey3yhViC26m_7e6i3hTH-JHwaZkaOc74f9ENH10hquN2W_sRA8Sor9WiS2M1khqn4wdnR10EIk"
      },
      "data": {
        "grant_type": "client_credentials"
      }
    };

    $.ajax(settings).done(function (response) {
      console.log(response);
    });
  }

  render() {
    return (
      <div className="App" >
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
          <p>
            Edit <code>src/App.js</code> and save to reload.
        </p>
          <a
            className="App-link"
            href="https://reactjs.org"
            target="_blank"
            rel="noopener noreferrer"
          >
            Learn React
        </a>
        </header>
      </div>
    );
  }
}

export default App;
